import React, { Component } from 'react';
import Image2 from '../Image/50-Beautiful-and-Minimalist-Presentation-Backgrounds-042.jpg';
import { Link, useNavigate } from 'react-router-dom';  // Updated for v6
import '../Add-Department/AddDepartment.css';

// Inline style definitions
const background = { backgroundSize: 'cover' };
const texts = { position: 'absolute' };

// Higher Order Component (HOC) to use hooks in a class component
function withRouter(Component) {
    function ComponentWithRouterProp(props) {
        const navigate = useNavigate();
        return <Component {...props} navigate={navigate} />;
    }
    return ComponentWithRouterProp;
}

class AddStudent extends Component {
    constructor() {
        super();
        this.state = {
            ids: 0,
            Reg: '',
            name: '',
            phone: '',
            branch: ''
        };
    }

    // Handles form submission
    onFormSubmitted = (e) => {
        e.preventDefault();
        this.props.addsubscriberHandler(this.state);  // Call the parent handler to submit form
        this.setState({ ids: 0, Reg: '', name: '', phone: '', branch: '' });  // Reset the form state
        this.props.navigate("/");  // Redirect to home page using navigate
    }

    // Handles input changes and updates state properly
    inputChangedHandler = (e) => {
        const { name, value } = e.target;
        this.setState({ [name]: value });
    }

    render() {
        return (
            <div className="main">
                <img style={background} className="images" height="100%" width="100%" src={Image2} alt="background" />
                <form style={texts} onSubmit={this.onFormSubmitted}>
                    <Link to="/">
                        <button type="button" className="back_btn">Back</button>
                    </Link>
                    <br />
                    <label htmlFor="Reg" className="label-control">Id: </label><br />
                    <input
                        id="Reg"
                        type="text"
                        className="input-control"
                        name="Reg"
                        placeholder="Enter ID"
                        value={this.state.Reg}
                        onChange={this.inputChangedHandler}
                    />
                    <br /><br />
                    <label htmlFor="name" className="label-control">Name: </label><br />
                    <input
                        id="name"
                        type="text"
                        className="input-control"
                        name="name"
                        placeholder="Enter Name"
                        value={this.state.name}
                        onChange={this.inputChangedHandler}
                    />
                    <br /><br />
                    <label htmlFor="phone" className="label-control">Phone: </label><br />
                    <input
                        id="phone"
                        type="text"
                        className="input-control"
                        name="phone"
                        placeholder="Enter Phone Number"
                        value={this.state.phone}
                        onChange={this.inputChangedHandler}
                    />
                    <br /><br />
                    <label htmlFor="branch" className="label-control">Branch: </label><br />
                    <input
                        id="branch"
                        type="text"
                        className="input-control"
                        name="branch"
                        placeholder="Enter Branch"
                        value={this.state.branch}
                        onChange={this.inputChangedHandler}
                    />
                    <br /><br />
                    <button type="submit" className="add">Add</button>
                </form>
            </div>
        );
    }
}

// Wrap the class component with withRouter HOC to use navigate prop
export default withRouter(AddStudent);
